import React, { Component } from 'react';
import * as ReactBootstrap from "react-bootstrap";
import "bootstrap/dist/css/bootstrap.min.css";

export default class OurServices extends React.Component {
    render() {
        return (
            <div>
                <ReactBootstrap.Image src="banner2.jpg" style={{"height":"200px", "width":"100%"}} />
                
                <ReactBootstrap.Container>

                  <ReactBootstrap.Row>
                    <ReactBootstrap.Col sm={8} variant="success">
                        sm=8
                    </ReactBootstrap.Col>
                    <ReactBootstrap.Col sm={4}>
                        sm=4
                    </ReactBootstrap.Col>
                  </ReactBootstrap.Row>

                  <ReactBootstrap.Row>
                    <ReactBootstrap.Col sm>sm=true</ReactBootstrap.Col>
                    <ReactBootstrap.Col sm>sm=true</ReactBootstrap.Col>
                    <ReactBootstrap.Col sm>sm=true</ReactBootstrap.Col>
                  </ReactBootstrap.Row>

                </ReactBootstrap.Container>
            </div>
        )
    }
}
